import React from 'react'
import "../pages/Signup.css";
import Grid from '@mui/material/Grid';
import Box from '@mui/material/Box';
import TextField from '@mui/material/TextField';

export default function Signup() {
    return (
        <>
            <Grid container>
                <Grid item lg={8} className="bg">
                    .
                </Grid>
                <Grid item lg={4}>
                    <form className="form">
                        <TextField className="my-4" label="Email" type="email" variant="standard" fullWidth={true} />
                        <TextField label="Password" type="password" variant="standard" fullWidth={true} />
                    </form>
                </Grid>
            </Grid>
        </>
    )
}
